“The main character Akissi is small but fierce, giving a real but humorous account of life in a part of Africa not often seen - the Ivory Coast neighbourhood of Yopougon. There is also a heavy emphasis on Ivory Coast cultural norms and a few recipes at the back of the book for the curious and hungry!”
~
@booktrust on Akissi: More Tales of Mischief by Marguerite Abouet and Mathieu Sapin ☀️
